CREATE VIEW public.view_historico_precos AS
 SELECT p.id AS produto_id,
    p.nome AS produto_nome,
    p.codigo AS produto_codigo,
    f.id AS fornecedor_id,
    f.nome AS fornecedor_nome,
    n.numero AS nota_numero,
    n.data_emissao,
    i.quantidade,
    i.valor_unitario,
    i.desconto,
    i.valor_liquido,
    (i.valor_liquido / i.quantidade) AS preco_unitario_liquido
   FROM (((public.itens_nota i
     JOIN public.notas n ON ((i.nota_id = n.id)))
     JOIN public.produtos p ON ((i.produto_id = p.id)))
     JOIN public.fornecedores f ON ((n.fornecedor_id = f.id)))
  WHERE ((p.ativo = true) AND (f.ativo = true))
  ORDER BY n.data_emissao DESC;


ALTER TABLE public.view_historico_precos OWNER TO postgres;

