CREATE VIEW public.view_produtos_estoque AS
 SELECT p.id,
    p.nome,
    p.codigo,
    p.fabricante,
    p.estoque_atual,
    p.estoque_minimo,
        CASE
            WHEN (p.estoque_atual <= p.estoque_minimo) THEN 'BAIXO'::text
            WHEN (p.estoque_atual <= (p.estoque_minimo * 1.5)) THEN 'ATENCAO'::text
            ELSE 'OK'::text
        END AS status_estoque,
    ( SELECT avg((i.valor_liquido / i.quantidade)) AS avg
           FROM (public.itens_nota i
             JOIN public.notas n ON ((i.nota_id = n.id)))
          WHERE ((i.produto_id = p.id) AND (n.data_emissao >= (CURRENT_DATE - '90 days'::interval)))) AS preco_medio_90dias
   FROM public.produtos p
  WHERE (p.ativo = true);


