--

CREATE VIEW public.view_produtos_historico AS
 SELECT p.id,
    p.nome,
    p.codigo,
    p.fabricante,
    ( SELECT avg((i.valor_liquido / i.quantidade)) AS avg
           FROM (public.itens_nota i
             JOIN public.notas n ON ((i.nota_id = n.id)))
          WHERE ((i.produto_id = p.id) AND (n.data_emissao >= (CURRENT_DATE - '90 days'::interval)))) AS preco_medio_90dias,
    ( SELECT max(n.data_emissao) AS max
           FROM (public.itens_nota i
             JOIN public.notas n ON ((i.nota_id = n.id)))
          WHERE (i.produto_id = p.id)) AS ultima_compra,
    ( SELECT f.nome
           FROM ((public.itens_nota i
             JOIN public.notas n ON ((i.nota_id = n.id)))
             JOIN public.fornecedores f ON ((n.fornecedor_id = f.id)))
          WHERE (i.produto_id = p.id)
          ORDER BY n.data_emissao DESC
         LIMIT 1) AS ultimo_fornecedor
   FROM public.produtos p
  WHERE (p.ativo = true);


